import React from 'react';

function Welcome(props) {
    return(
        <div>
            <p>Hey! I'm a Welcome Component!</p>
            <p>This is a name prop being passed from App.js to Welcome/index.js: {props.name}</p>
        </div>
    );
}

export default Welcome;
